import '../styles/storyTop.scss'
import katrinakaif from '../story/katrinakaif.jpg'
import kritisanon from '../story/kritisanon.jpg'


function StoryTop(){
    const storiesData = [
        {
            img:katrinakaif,
            name:'Katrinakaif'
        },{
            img:kritisanon,
            name:"Kritisanaon"
        }
    ]
    return(
        <div className='stories'>
            <div className="story">
                {
                    storiesData.map((data, index)=>(
                        <div className="profiles" key={index}>

                            <img src={data.img} alt="" />
                            <p>{data.name}</p>
                        </div>
                    ))
                }
            </div>
        </div>
    )
}
export default StoryTop;
